let SKIN_TONE_MODIFIER = new RegExp("\ud83c[\udffb-\udfff]", "g");
function removeSkinTone(string) {
    // https://jsfiddle.net/1bvs7y2a/
    // Remove skin tone modifier
    return string.replace(SKIN_TONE_MODIFIER, "");
}


function demojize(string, removeSkinTones, language = 'alias') {
    if (removeSkinTones) {
        string = removeSkinTone(string);
    }

    let useAliases = language === 'alias';
    if (useAliases) {
        language = 'en';
    }

    let chars = Array.from(string);

    let result = [];
    let i = 0;
    let length = chars.length;
    while (i < length) {
        let consumed = false;
        let char = chars[i];
        if (char in EMOJI_SEARCH_TREE) {
            let j = i + 1;
            let subTree = EMOJI_SEARCH_TREE[char];
            while (j < length && chars[j] in subTree) {
                subTree = subTree[chars[j]];
                j += 1;
            }
            if ('data' in subTree) {
                let emjData = subTree.data;
                let replaceStr;
                if (language in emjData) {
                    if (useAliases && 'alias' in emjData) {
                        replaceStr = emjData['alias'][0];
                    } else {
                        replaceStr = emjData[language];
                    }
                } else {
                    replaceStr = chars.slice(i, j).join('');
                }
                i = j - 1;
                consumed = true;
                if (replaceStr) {
                    result.push(replaceStr);
                }
            }
        }
        if (!consumed && char !== '\ufe0e' && char !== '\ufe0f') {
            result.push(char);
        }
        i += 1;
    }
    return result.join('');
}